import React from 'react';
import { Anchor } from 'antd';

const App = () => (
  <div style={{ margin: '20px' }}> {/* Ajoute des marges de 20px autour de votre application */}
    <>
      <div
        style={{
          padding: '0px',
          overflowX: 'hidden',
        }}
      >
        <Anchor
          direction="horizontal"
          items={[
            {
              key: 'part-1',
              href: '#part-1',
              title: 'Home',
            },
            {
              key: 'part-2',
              href: '#part-2',
              title: 'Formations',
            },
            {
              key: 'part-3',
              href: '#part-3',
              title: 'Réalisations',
            },
          ]}
        />
      </div>
      <div>
        <div
          id="part-1"
          style={{
            width: '100vw',
            height: '100vh',
            textAlign: 'center',
            background: 'rgba(0,255,0,0.02)',
          }}
        />
        <div
          id="part-2"
          style={{
            width: '100vw',
            height: '100vh',
            textAlign: 'center',
            background: 'rgba(0,0,255,0.02)',
          }}
        />
        <div
          id="part-3"
          style={{
            width: '100vw',
            height: '100vh',
            textAlign: 'center',
            background: '#FFFBE9',
          }}
        />
      </div>
    </>
  </div>
);

export default App;
